import { useEffect } from "react";
import { useNavigate } from "react-router-dom"
import styled from "styled-components";
import welcome from "../assets/img/welcome.svg";

export function Welcome() {
  // Cập nhật title
  useEffect(() => {
    document.title = "HomePage";
  });

  const navigate = useNavigate()



  function handleClick() {
    navigate("/posts")
  }

  return (
    <SContainer className="container" style={{ marginTop: 120, marginBottom: 80 }}>
      <div className="row">
        <div className="col-md-6">
          <img src={welcome} className="img-fluid" alt="Welcome" />
        </div>
        <SContent className="col-md-6">
          <h3>Welcome to My Blog</h3>
          <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Recusandae temporibus iste minima repellendus officiis nihil culpa quas. Dolor fuga doloremque aperiam dolorem rem dignissimos, provident harum, molestiae, id nemo sint!</p>
          <div>
            <SButtonUser 
            className="btn btn-sm btn-primary"
            onClick={handleClick}
          >User</SButtonUser>
            <SButtonAdmin className="btn btn-sm btn-success">Admin</SButtonAdmin>
          </div>
          </SContent>
      </div>
    </SContainer>
  );
}

const SContainer = styled.div`
  border: 1px solid #333;
`
const SContent = styled.div`
border: 1px solid red;
